import { Component } from '@angular/core';

@Component({
  selector: 'app-dashboard',
  templateUrl: './dashboard.component.html',
  styleUrls: ['./dashboard.component.scss']
})
export class DashboardComponent {
  menuItems = [
    { label: 'Kitablar', route: '/dashboard/book/book-list' },
    { label: 'Tipləri', route: '/dashboard/type/type-list' },
    { label: 'Müəllifləri', route: '/dashboard/author/author-list' },
  ];
}
